import SignUp from './components/SignUp'
import { BrowserRouter as Routes ,Router,Switch} from 'react-router-dom'
export default function App() {
  return (
   <Routes className='App'>
    
        <Router path='/user-signup'>
            <SignUp/>
        </Router>
    
   </Routes>
  )}
